import React from 'react';
import ReactDOM from 'react-dom';

const name = "Jun Xiang";
const element = <h1>Hello, {name+' hi'}!</h1>

// ReactDOM.render 貌似是一个渲染函数（x,y）
ReactDOM.render(
    element,
    document.getElementById('root')
);
